      if (this.dataModels.currentProject.get("id")) {
        return this.actualSaveCurrentProject();
      } else {
        saveAs = new quadrigram.Views.SaveAsDialog({
          type: "save",
          callBack: this.actualSaveCurrentProject
        });
        return saveAs.render();
      }
